        { id: 2, title: "js", isDone: true },
        { id: 3, title: "react", isDone: false },
    ]

    return (

        <div className="App">
            <Todolist title="What to learn?" />
            <Todolist title="Movies" />
            <Todolist title="Songs" />
        </div>
    );
}


export default App;
